# coding=utf-8
from flask import session
from flask_restful import Resource


class Qr(Resource):
    def get(self):
        print('Qr', session['session_id'])
        return {
            'success': True,
            'data': 'data:image/jpeg;base64,'
        }


class LoginStatus(Resource):
    def get(self):
        print('LoginStatus', session['session_id'])
        return {
            'success': True,
            'data': 'LOGINING'
        }
